// API 엔드포인트
const apiUrl = 'https://www.eshare.go.kr/eshare-openapi/rsrc/detail/d41d8cd98f003204a9800998ecf8427e';

// 한 번에 보낼 데이터 개수
const batchSize = 100;

// 데이터를 일정 개수씩 끊어서 호출하는 함수
async function sendBatch(data) {
  try {
    // 데이터를 일정 개수씩 나누기
    const batches = [];
    for (let i = 0; i < data.length; i += batchSize) {
      batches.push(data.slice(i, i + batchSize));
    }

    // 각 배치별로 요청 보내고 다운로드
    for (const batch of batches) {
      const response = await fetch(apiUrl, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json' // 요청 헤더에 JSON 형식으로 데이터를 전달한다고 명시
        },
        body: '{"rsrcNoList" : [' + batch + ']}' // 데이터를 JSON 문자열로 변환하여 요청 본문에 넣음
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      // 응답 데이터를 Blob으로 변환
      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);

      // 다운로드 링크 생성
      const a = document.createElement('a');
      a.href = url;
      a.download = 'data_batch_' + batches.indexOf(batch) + '.txt'; // 다운로드할 파일명 지정

      // 다운로드 링크 클릭 및 자원 해제
      document.body.appendChild(a);
      a.click();
      window.URL.revokeObjectURL(url);
    }

    console.log('All batches sent and downloaded successfully.');
  } catch (error) {
    console.error('Error sending batches:', error);
  }
}

// 데이터 전송 및 다운로드 시작
